import React, { useState, useEffect } from 'react';
import './App.css';
import TreeView from './TreeView';

// import { data } from './data';
const tree = {
  name: "Root",
  data: [
    { name: "1", data: [{ name: "1.1", data: [{ name: "1.1.1", data: [{ name: "1.1.1.1", data: null }] }] }, { name: "1.2", data: [{ name: "1.2.1", data: [{ name: "1.2.1.1", data: null }] }] }] },
    { name: "2", data: [{ name: "2.1", data: [{ name: "2.1.1", data: [{ name: "2.1.1.1", data: null }] }] }] }
  ],
}


function App() {
  return (
    <>
      <div className="App">
        <TreeView index={0} data={tree.data} name={tree.name} />
      </div>
    </>
  );
}

export default App;
